import React from "react";
import { TableOfProducts } from "./TableOfProducts";
import { Boxes } from "./Boxes";

export const MainPage = () => {
  <document className="getElementsByid"></document>("mini_sidebar").onmouseover =
    'document.getElementsByClassName("main_page").style.background="red" ';
  return (
    <div className="main_page">
      <Boxes />
      <TableOfProducts />
    </div>
  );
};
